Guys, I've mathematically solved the main Osmows menu:

P = {Chicken, Beef, Lamb, Kofta, Beyond-Meat}
V = {Wrap, Rice}

PxV is the menu, where P is the set of protien options, V is the set of vehicles for the protien (Ozbox omited for simplicity)

```bool isValid(char* s) {
   char stack[10000];
    int top = -1;

    for (int i = 0; s[i] != '\0'; ++i) {
        char c = s[i];
        switch (c) {
            case '(':
            case '{':
            case '[':
                if (top < sizeof(stack) - 1) {
                    stack[++top] = c;
                }
                break;
            case ')':
                if (top == -1 || stack[top] != '(') return false;
                top--;
                break;
            case '}':
                if (top == -1 || stack[top] != '{') return false;
                top--;
                break;
            case ']':
                if (top == -1 || stack[top] != '[') return false;
                top--;
                break;
            default:
                return false;
        }
    }
    return top == -1;
}```
